CREATE DEFINER=`root`@`localhost` PROCEDURE `login`(IN uemail varchar(45), IN upass VARCHAR(45))
BEGIN
SELECT substr(password,1,32), substr(password,34,65) INTO @bs, @salt
FROM volonter
where email = uemail;
select md5(concat(upass , @salt)) into @md5;
IF @md5 = @bs THEN
SELECT id,ime,usertype from volonter where email = uemail LIMIT 1;
