SELECT * FROM volonter where id < 0;
END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `register`(IN uprezime varchar(45), IN uime VARCHAR(45),IN uemail VARCHAR(45),IN uuser VARCHAR(45),IN upass VARCHAR(45),IN uadresa VARCHAR(45),IN utel VARCHAR(45),IN upol INT,IN uzanimanje TEXT,IN usskola TEXT,IN faks TEXT,IN voli TEXT,IN radi TEXT,IN nag TEXT)
BEGIN
SET @salt = md5(concat(uime,uuser,curtime(),uemail));
SET @passmd5 = md5(concat(upass,@salt));
SET @upassfinal = concat(@passmd5,':',@salt);
VALUES (uime,uprezime,uemail,uuser,@upassfinal,CURDATE(),uadresa,utel,upol,uzanimanje,usskola,faks,voli,radi,nag);
END$$

